resources.string:
Când este activată, utilizaţi fixarea ecr pt a menţine ecr curent în vizualiz până când anulaţi fixarea.

Pt a utiliza fixarea ecr:

1. asiguraţi-vă că fcţ de fixare a ecr este activată;

2. desch ecr pe care doriţi să îl fixaţi;

3. ating tasta pt aplic recente;

4. ating pict de fixare.
